Although one of WASM's features is its size and load-time efficient binary format, it also has a text representation that can be useful for debugging. In both binary and text formats, WebAssembly is represented by S-expressions . S-exprs are an old and simple format for representing trees. The root of a WebAssembly tree is a module . The module below has a func node and an export node: (module (func $add (param $lhs i32) (param $rhs i32) (result i32) local.get $lhs local.get $rhs i32.add) (export "add" (func $add))
) Each supported language has a tool chain for compiling text to binary. For C/C++ the tool is called emscripten , and for text the tool is called wat2wasm and comes from WABT . WebAssembly is noy yet integrated with HTML <script type='module'> or Javascript import statements, so you have to create an ArrayBuffer to load the raw bytes and then compile/intantiate the program. WebAssembly.instantiateStreaming(fetch("myModule.wasm"), importObject).then( (obj) => { // Call an exported function: obj.instance.exports.exported_func(); // or access the buffer contents of an exported memory: const i32 = new Uint32Array(obj.instance.exports.memory.buffer); // or access the elements of an exported table: const table = obj.instance.exports.table; console.log(table.get(0)()); },
); wat2wasm demo

