To avoid all the copying, this version will give JavaScript a pointer to the Universe, so that the next move is determined by Rust but the rendering is done by JavaScript. First change the pre-formatted text box into a proper canvas: <body> <canvas id="game-of-life-canvas"></canvas> <script src="./bootstrap.js"></script> </body> The refresh loop of JavaScript is similar to before, in that Rust generates the next iteration and we update the canvas with the new Universe. However, notice that now JavaScript explicitly imports the memory and the universe Cell so it can look at the game board directly. import { memory } from "wasm-game-of-life/wasm_game_of_life_bg";
import { Universe, Cell } from "wasm-game-of-life"; const CELL_SIZE = 5; // px
const GRID_COLOR = "#CCCCCC";
const DEAD_COLOR = "#FFFFFF";
const ALIVE_COLOR = "#000000"; // Construct the universe, and get its width and height.
const universe = Universe.new();
const width = universe.width();
const height = universe.height(); // Give the canvas room for all of our cells and a 1px border
// around each of them.
const canvas = document.getElementById("game-of-life-canvas");
canvas.height = (CELL_SIZE + 1) * height + 1;
canvas.width = (CELL_SIZE + 1) * width + 1; const ctx = canvas.getContext('2d'); const renderLoop = () => { universe.tick(); drawGrid(); drawCells(); requestAnimationFrame(renderLoop);
}; To draw the new universe, Javascript gets a pointer to the cells. Then it tranverses the rows and columns rendering each cell as a filled rectangle: const drawCells = () => { const cellsPtr = universe.cells(); const cells = new Uint8Array(memory.buffer, cellsPtr, width * height); ctx.beginPath(); for (let row = 0; row < height; row++) { for (let col = 0; col < width; col++) { const idx = getIndex(row, col); ctx.fillStyle = cells[idx] === Cell.Dead ? DEAD_COLOR : ALIVE_COLOR; ctx.fillRect( col * (CELL_SIZE + 1) + 1, row * (CELL_SIZE + 1) + 1, CELL_SIZE, CELL_SIZE ); } } ctx.stroke();
}; Now Rust is updating the game board and JavaScript is rendering it. This design reduces memory copying and lets each component do what it does best. (from the Rust and WebAssembly Tutorial )

